Метрополите́н (от фр. métropolitain, сокр. от chemin de fer métropolitain — «столичная железная дорога»), метро́ (фр. métro, англ. subway или metro, а также брит. англ. underground либо tube (на сленге)) — городская внеуличная железная дорога, имеющая собственный габарит, инженерно отделённая от любого другого вида общественного транспорта и пешеходного движения и предназначенная для пассажирского движения. Может быть подземным (в тоннелях), наземным (на поверхности земли) и надземным (на эстакадах).Подземные метро характерны запахом, вызванным пропитками деревянных шпал креозотом, постепенно заменяемыми на железобетонные. Движение поездов в метрополитене регулярное, согласно графику движения. Метрополитену свойственны высокая маршрутная скорость (до 80 км/ч) и провозная способность (до 60 тыс. пассажиров в час в одном направлении). Крупнейшие метрополитены в мире: 
* по количеству станций и маршрутов — Нью-Йоркский (472 станции, 28 маршрутов); 
* по длине линий — Шанхайский (743 км) и Пекинский (727 км); 
* по годовому пассажиропотоку — Пекинский и Токийский; 
* по суточному пассажиропотоку — Пекинский. Самые короткие (короче 9 км) метрополитены: в венесуэльском Маракайбо, индийском Ахмадабаде, итальянских Катании и Генуе, украинском Днепре. Лозанна, Брешиа и Ренн — самые маленькие города мира, имеющие метрополитен. Российские города, имеющие метрополитен: Москва (с 1935), Санкт-Петербург (с 1955), Нижний Новгород (с 1985), Новосибирск (с 1986), Самара (с 1987), Екатеринбург (с 1991), Казань (с 2005).
